import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
 
 
 import Card from "../Card/Card"

const products=[
	{
	id:"01",
	description:"iPhone-12",
	price:"BTD-180000",
	src:"./img/product.png"
},
{ 
	id:"02",
	description:"iPhone-11 ",
	price:"BDT-160000",
	src:"img/product.png",
},
 
 
]
 

const ProductCard = () => {
	
	return (
		<>
			
				 
						<Row>
                       
                            
								

								  {
								 
								 products.map((product)=>(

									<Col    sm={6} md={6} className="mb-3" 	key={product.id} >
									
									<Card
								
								product={product}
									/>
									  </Col>

								  ))} 
								
						</Row>
				 
				
			
		</>
	);
};

export default ProductCard;
